CREATE TABLE IF NOT EXISTS SUBJECT_HOURS
(
    ID            BIGINT auto_increment
        primary key,
    CREATED_DATE  TIMESTAMP,
    HOURS         INTEGER                not null,
    MODIFIED_DATE TIMESTAMP,
    SUBJECT       BIGINT,
    SUBJECT_NAME  CHARACTER VARYING(255) not null,
    DELETED BOOLEAN
);

